  false,\n\t\"url\": null,\n\t\"notes\": \"This accession contains the data descriptions
  for the OSTM/Jason-2 Telemetry data, which is served through the NOAA/NESDIS Comprehensive
  Large Array-data Stewardship System (CLASS): http://www.class.noaa.govnnOSTM/Jason-2
  is a follow-on mission to Jason-1, which takes over and continues the TOPEX/Poseidon
  and Jason-1 missions. OSTM/Jason-2 involves Centre National d'Etudes Spatiales (CNES),
  NASA and 2 new partners: the European Organisation for the Exploitation of Meteorological
  Satellites (EUMETSAT) and NOAA in order to 1) ensure continuity of high quality
  measurements for ocean science, and 2) provide operational products for assimilation
  and forecasting applications. OSTM/Jason-2 was launched on 20 June 2008 and reached
  its nominal repetitive orbit on 4 July 2008. The start of cycle 1 occurred on 12
  July 2008.nnTelemetry - Dataset consists of raw Level-0 telemetry data from the
  Jason-2 spacecraft. There are three datatypes available: Housekeeping Telemetry
  - Recorded (HKTM-R) is stored on the spacecraft for later downlink; Payload Telemetry
  1 (PLTM-1) is the payload science data from the core-mission payloads: Poseidon-3,
  DORIS, AMR, and GPSP; and Payload Telemetry 2 (PLTM-2) is the payload science data
  from the passenger mission of opportunity payloads: CARMEN-2, L2T2 and LPT. They
  are available as CCSDS packet files. All telemetry data (J2-TEL) are restricted
  to the project team, per the mission's 4-partner Memorandum of Understanding. For
  these restricted data families, users will only see listed those datatypes upon
  which they can search.nnOther data/products associated with OSTM/Jason-2 are also
  provided through CLASS. They are: Level-2 Geophysical Data Records (GDR), ancillary
  and auxiliary data files used to generate Level-2 products, quality reports from
  the near real-time altimetry validation system (NRTAVS) and orbit information of
  JASON-2 satellite. The descriptions of these data products can also be accessed
  in other accessions at NODC.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
